import { Button, TextField, Typography } from '@mui/material'
import React, { useState } from 'react'

const ToDo = () => {

  var [useritem,setuseritem]=useState("");  
  const myitemhandle = (event) => {
    setuseritem(
        useritem=event.target.value
    )

  }
  return (
    <div>
        <TextField variant='standard' value={useritem} onChange={myitemhandle}  label='Enter an Item'></TextField>
        <TextField variant='standard' label='Quantity'></TextField>
        <TextField variant='standard' label='Price'></TextField>

        <Button variant='contained' color='secondary'  >Save</Button>

      <Typography>{useritem}</Typography>
    </div>
  )
}

export default ToDo
